"use client";

import Link from "next/link";
import { useRef, useState, useEffect } from "react";
import Image from "next/image";
import { PrimaryBtnLink } from "@/components/Buttons";

export default function NavBar() {
  const [isMobileOpen, setIsMobileOpen] = useState(false);
  const [isInnerPageOpen, setIsInnerPageOpen] = useState(false);
  const [hoverInnerPage, setHoverInnerPage] = useState(false);
  const [isScrolled, setIsScrolled] = useState(false);
  const [isScaling, setIsScaling] = useState(false);

  const innerPageTimer = useRef<ReturnType<typeof setTimeout> | null>(null);
  const scaleTimer = useRef<ReturnType<typeof setTimeout> | null>(null);

  useEffect(() => {
    const handleScroll = () => {
      const scrollTop = window.scrollY;
      setIsScrolled(scrollTop > 0);
      
      // Trigger scale animation on any scroll
      setIsScaling(true);
      
      // Clear existing timer
      if (scaleTimer.current) {
        clearTimeout(scaleTimer.current);
      }
      
      // Set timer to return to normal scale after 0.3 seconds
      scaleTimer.current = setTimeout(() => {
        setIsScaling(false);
      }, 300);
    };

    window.addEventListener('scroll', handleScroll);
    return () => {
      window.removeEventListener('scroll', handleScroll);
      if (scaleTimer.current) {
        clearTimeout(scaleTimer.current);
      }
    };
  }, []);

  const cancelTimer = (ref: React.MutableRefObject<ReturnType<typeof setTimeout> | null>) => {
    if (ref.current) {
      clearTimeout(ref.current);
      ref.current = null;
    }
  };

  const leaveWithDelay = (
    ref: React.MutableRefObject<ReturnType<typeof setTimeout> | null>,
    setOpen: (open: boolean) => void,
    delayMs = 200
  ) => {
    cancelTimer(ref);
    ref.current = setTimeout(() => setOpen(false), delayMs);
  };

  const toggleMobile = () => setIsMobileOpen((v) => !v);
  const closeMobile = () => setIsMobileOpen(false);

  const Arrow = ({ rotated = false, className = "", isMobile = false }: { rotated?: boolean; className?: string; isMobile?: boolean }) => (
    <svg
      className={`ml-2 transition-transform duration-200 ${rotated ? "rotate-180" : "rotate-0"} ${isMobile ? "h-[10px] w-[10px]" : "h-2 w-2"} ${className}`}
      viewBox="0 0 12 8"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      aria-hidden="true"
    >
      <path d="M10.59 0.589844L6 5.16984L1.41 0.589844L0 1.99984L6 7.99984L12 1.99984L10.59 0.589844Z" fill="currentColor" />
    </svg>
  );

  return (
    <header className={`sticky top-0 z-50 transition-all duration-500 ease-in-out ${
      isScrolled 
        ? 'py-2 bg-[#40afec]/80 backdrop-blur-xl shadow-[0_8px_32px_rgba(26,121,180,0.3),0_2px_8px_rgba(0,0,0,0.1)] border-b border-white/10' 
        : 'py-2 bg-[#40afec]'
    } ${isMobileOpen ? 'bg-[#40AFEC]' : ''}`}>
      {/* Subtle gradient overlay when scrolled */}
      {isScrolled && (
        <div className="absolute inset-0 bg-gradient-to-r from-[#40afec]/10 via-transparent to-[#1A79B4]/10 pointer-events-none" />
      )}
      
      <nav className="mx-auto max-w-6xl px-4 sm:px-6 lg:px-8 relative">
        <div className={`flex items-center justify-between transition-all duration-300 ${
          isScrolled ? 'h-16' : 'h-19'
        }`}>
          {/* Left: Logo */}
          <div className="flex items-center">
            <Link href="/" className="text-base font-semibold tracking-tight">
              {/* <Image 
                src="/logo.svg" 
                alt="Hexic FF" 
                width={280} 
                height={58} 
                className={`transition-all duration-300 ${
                  isScrolled ? 'scale-90' : 'scale-100'
                }`}
              /> */}
              <div className="flex flex-row flex-nowrap items-center justify-start gap-3">
                  {/* Logo Head */}
                  <svg 
                    xmlns="http://www.w3.org/2000/svg"  
                    width="55" 
                    height="58" 
                    viewBox="0 0 55 58" 
                    fill="none"
                    className={`${
                      isScaling 
                        ? 'logo-scale-up' 
                        : 'logo-scale-normal'
                    }`}
                  >
                    <rect width="55" height="58" fill="url(#pattern0_131_1596)"/>
                    <defs>
                    <pattern id="pattern0_131_1596" patternContentUnits="objectBoundingBox" width="1" height="1">
                    <use href="#image0_131_1596" transform="matrix(0.00241315 0 0 0.00228833 -0.00434783 0)"/>
                    </pattern>
                    <image id="image0_131_1596" width="418" height="437" preserveAspectRatio="none" href="data:image/png;base64,"/>
                    </defs>
                  </svg>
                  {/* Logo Title */}
                  <svg xmlns="http://www.w3.org/2000/svg"  width="210" height="40" viewBox="0 0 210 40" fill="none">
                    <rect width="210" height="40" fill="url(#pattern0_131_1597)"/>
                    <defs>
                    <pattern id="pattern0_131_1597" patternContentUnits="objectBoundingBox" width="1" height="1">
                    <use href="#image0_131_1597" transform="matrix(0.0010846 0 0 0.00569414 0 0.0188449)"/>
                    </pattern>
                    <image id="image0_131_1597" width="922" height="169" preserveAspectRatio="none" href="data:image/png;base64,"/>
                    </defs>
                  </svg>
              </div>
            </Link>
          </div>

          {/* Center: Main Menu (Desktop) */}
          <div className="hidden md:flex items-center space-x-8">
            <Link
              href="#"
              className={`text-sm font-medium px-4 py-2 rounded-lg transition-all duration-300 hover:bg-white/20 hover:backdrop-blur-sm hover:shadow-lg hover:scale-105 ${
                isScrolled ? 'hover:bg-white/30' : 'hover:bg-[#1A79B4]'
              }`}
            >
              Inner Page
            </Link>
            
            <Link
              href="#"
              className={`text-sm font-medium px-4 py-2 rounded-lg transition-all duration-300 hover:bg-white/20 hover:backdrop-blur-sm hover:shadow-lg hover:scale-105 ${
                isScrolled ? 'hover:bg-white/30' : 'hover:bg-[#1A79B4]'
              }`}
            >
              Inner Page
            </Link>

            {/* Inner Page with Dropdown */}
            <div className="relative">
              <Link
                href="#"
                className={`text-sm font-medium px-4 py-2 rounded-lg transition-all duration-300 hover:bg-white/20 hover:backdrop-blur-sm hover:shadow-lg hover:scale-105 flex items-center ${
                  isScrolled ? 'hover:bg-white/30' : 'hover:bg-[#1A79B4]'
                }`}
                onMouseEnter={() => {
                  cancelTimer(innerPageTimer);
                  setHoverInnerPage(true);
                }}
                onMouseLeave={() => leaveWithDelay(innerPageTimer, setHoverInnerPage)}
              >
                Inner Page
                <Arrow rotated={hoverInnerPage} />
              </Link>
              <div
                className={`absolute left-0 top-full ${
                  hoverInnerPage ? "block" : "hidden"
                } min-w-56 bg-background/90 backdrop-blur-xl shadow-[0_20px_40px_rgba(0,0,0,0.15)] rounded-2xl mt-2 border border-white/10 overflow-hidden`}
                onMouseEnter={() => {
                  cancelTimer(innerPageTimer);
                  setHoverInnerPage(true);
                }}
                onMouseLeave={() => leaveWithDelay(innerPageTimer, setHoverInnerPage)}
              >
                <Link href="#" className="block px-4 py-3 text-sm hover:bg-white/10 transition-all duration-200">Inner Page</Link>
                <Link href="#" className="block px-4 py-3 text-sm hover:bg-white/10 transition-all duration-200">Inner Page</Link>
                <Link href="#" className="block px-4 py-3 text-sm hover:bg-white/10 transition-all duration-200">Inner Page</Link>
              </div>
            </div>
          </div>

          {/* Right: Button Link (Desktop) */}
          <div className="hidden md:flex">
            <PrimaryBtnLink href="#" className="!px-[20px]">
              Start Swapping
            </PrimaryBtnLink>
          </div>

          {/* Mobile: Hamburger on the right */}
          <div className="flex items-center md:hidden">
            <button
              aria-label={isMobileOpen ? "Close menu" : "Open menu"}
              onClick={toggleMobile}
              className="hamburger-btn p-2 hover:cursor-pointer"
            >
              {/* Animated hamburger → X */}
              <div className="relative h-[14px] w-6">
                <span
                  className={`absolute right-0 block h-[2px] bg-current transition-all duration-200 ${
                    isMobileOpen ? "top-1/2 w-6 rotate-45" : "top-0 w-6 rotate-0"
                  }`}
                />
                <span
                  className={`absolute right-0 block h-[2px] bg-current transition-all duration-200 ${
                    isMobileOpen ? "top-1/2 w-0 opacity-0" : "top-[6px] w-[70%] opacity-100"
                  }`}
                />
                <span
                  className={`absolute right-0 block h-[2px] bg-current transition-all duration-200 ${
                    isMobileOpen ? "top-1/2 w-6 -rotate-45" : "top-[12px] w-6 rotate-0"
                  }`}
                />
              </div>
            </button>
          </div>
        </div>
      </nav>

      {/* Mobile menu panel (absolute, does not push content) */}
      <div
        aria-hidden={!isMobileOpen}
        className={`md:hidden absolute left-0 right-0 top-full z-40 overflow-hidden transition-all duration-500 ease-in-out ${
          isScrolled 
            ? 'bg-[#40AFEC]/90 backdrop-blur-xl border-t border-white/10' 
            : 'bg-[#40AFEC]'
        } ${isMobileOpen ? "opacity-100 translate-y-0 max-h-[85vh] pointer-events-auto" : "opacity-0 -translate-y-4 max-h-0 pointer-events-none"}
        `}
      >
        <div className="px-4 pt-6 pb-2">
          {/* Inner Page Links (mobile) */}
          <Link
            href="#"
            onClick={closeMobile}
            className="block py-4 px-4 text-lg font-medium rounded-xl transition-all duration-300 hover:bg-white/10 hover:translate-x-2"
          >
            Inner Page
          </Link>

          <Link
            href="#"
            onClick={closeMobile}
            className="block py-4 px-4 text-lg font-medium rounded-xl transition-all duration-300 hover:bg-white/10 hover:translate-x-2"
          >
            Inner Page
          </Link>

          {/* Inner Page with Dropdown (mobile) */}
          <div
            className={`w-full flex items-center justify-between py-4 text-lg font-medium px-4 rounded-xl transition-all duration-300 hover:bg-white/10 ${
              isInnerPageOpen ? "bg-white/5" : ""
            }`}
          >
            <Link href="#" onClick={closeMobile} className="flex-1">
              Inner Page
            </Link>
            <button
              aria-label={isInnerPageOpen ? "Collapse Inner Page" : "Expand Inner Page"}
              className="p-2 -mr-2 rounded-lg hover:bg-white/10 transition-all duration-200"
              onClick={(e) => {
                e.preventDefault();
                e.stopPropagation();
                setIsInnerPageOpen((v) => !v);
              }}
            >
              <Arrow rotated={isInnerPageOpen} isMobile={true} />
            </button>
          </div>
          <div
            className={`overflow-hidden transition-all duration-400 ease-in-out ml-4 ${
              isInnerPageOpen ? "max-h-60 opacity-100 translate-y-0" : "max-h-0 opacity-0 -translate-y-2"
            }`}
          >
            <Link href="#" onClick={closeMobile} className="block px-8 py-4 text-lg rounded-xl transition-all duration-300 hover:bg-white/10 hover:translate-x-2">Inner Page</Link>
            <Link href="#" onClick={closeMobile} className="block px-8 py-4 text-lg rounded-xl transition-all duration-300 hover:bg-white/10 hover:translate-x-2">Inner Page</Link>
            <Link href="#" onClick={closeMobile} className="block px-8 py-4 text-lg rounded-xl transition-all duration-300 hover:bg-white/10 hover:translate-x-2">Inner Page</Link>
          </div>

          {/* Button Link (mobile) */}
          <div className="py-7 px-4">
            <PrimaryBtnLink href="#" onClick={closeMobile} className="w-full">
              Start Swapping
            </PrimaryBtnLink>
          </div>
        </div>
      </div>
    </header>
  );
}


